    .overlay {
      position: fixed;
      top: 0; left: 0;
      width: 100%;
      height: 100%;
      background: rgba(0, 0, 50, 0.6);
      z-index: -1;
    }
    .login-card, .dashboard {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      background: rgba(255, 255, 255, 0.1);
      padding: 30px;
      border-radius: 15px;
      box-shadow: 0 4px 20px rgba(0,0,0,0.5);
      text-align: center;
      backdrop-filter: blur(10px);
    }
    input {
      padding: 10px;
      margin: 10px;
      width: 80%;
      border: none;
      border-radius: 8px;
    }
    button {
      padding: 12px 20px;
      margin-top: 15px;
      border: none;
      border-radius: 8px;
      background: linear-gradient(135deg, #007BFF, #0056b3);
      color: white;
      font-size: 16px;
      cursor: pointer;
      transition: all 0.3s ease;
    }
    button:hover {
      transform: scale(1.05);
      box-shadow: 0 4px 15px rgba(0,0,0,0.3);
    }
    .dashboard {
      display: none;
      width: 90%;
      max-width: 600px;
    }
    .card-btn {
      display: block;
      margin: 20px auto;
      padding: 20px;
      border-radius: 12px;
      background: linear-gradient(135deg, #007BFF, #0056b3);
      font-size: 18px;
      font-weight: bold;
      text-decoration: none;
      color: white;
      cursor: pointer;
      transition: all 0.3s ease;
    }
    .card-btn:hover {
      transform: scale(1.05);
      box-shadow: 0 6px 20px rgba(0,0,0,0.4);
    }
  </style>

<body>
  <div class="background"></div>
  <div class="overlay"></div>

  <div id="login-screen" class="login-card">
    <h2>Login to IMATAA E-LIBRARY</h2>
    <input type="text" id="username" placeholder="Username"><br>
    <input type="password" id="password" placeholder="Password"><br>
    <button onclick="login()">Login</button>
  </div>

  <div id="dashboard" class="dashboard">
    <h2>Welcome to IMATAA E-LIBRARY</h2>
    <div class="card-btn" onclick="openLibrary('medical')">Medical & Nursing Library</div>
    <div class="card-btn" onclick="openLibrary('teaching')">Education Teaching Library</div>
    <div class="card-btn" onclick="openLibrary('secondary')">Secondary Education Library</div>
  </div>

  <script>
    // Login handling
    const validUser = "Imataalib13";
    const validPass = "1234";
    const libraryPasswords = {
      medical: "med123",
      teaching: "teach123",
      secondary: "sec123"
    };

    function login() {
      const user = document.getElementById("username").value;
      const pass = document.getElementById("password").value;
      if (user === validUser && pass === validPass) {
        document.getElementById("login-screen").style.display = "none";
        document.getElementById("dashboard").style.display = "block";
      } else {
        alert("Invalid username or password!");
      }
    }

    function openLibrary(type) {
      const enteredPass = prompt("Enter password for " + type + " library:");
      if (enteredPass === libraryPasswords[type]) {
        if (type === "medical") {
          window.location.href = "https://imataa.blogspot.com/";
        } else if (type === "teaching") {
          window.location.href = "https://imataaeelibrary.blogspot.com/?zx=9536f4e4ed9ec1c";
        } else if (type === "secondary") {
          window.location.href = "https://imataae-library.blogspot.com/";
        }
      } else {
        alert("Incorrect password for " + type + " library.");
      }
    }

    // Register embedded Service Worker
    if ("serviceWorker" in navigator) {
      const swCode = `
        self.addEventListener('install', event => {
          event.waitUntil(
            caches.open('imataa-cache').then(cache => {
              return cache.addAll(['./']);
            })
          );
        });

        self.addEventListener('fetch', event => {
          event.respondWith(
            caches.match(event.request).then(response => {
              return response || fetch(event.request);
            })
          );
        });
      `;
      const blob = new Blob([swCode], { type: "text/javascript" });
      const swURL = URL.createObjectURL(blob);
      navigator.serviceWorker.register(swURL);
    }
  </script>
</body>
</html>
